import React from "react";
import "./Form.css";

function NewForm() {
  return (
    <div>
        Username
      <input type="text"/>{<br></br>}
        Age (year)
      <input type="number"/>{<br></br>}
      <button type="submit">Add user</button>{<br></br>}
    </div>
  );
}

export default NewForm;
